sourcesContent:
import { Router } from "express";
import {
  crearClientes,
  getClientes,
  getClienteById,
  deleteCliente,
  updateCliente,
  enviarCorreo,
  ValidarUsuario,
  CodigoVerificacionLogin,
} from "../controllers/clientesController";

const cors = require("cors");
const router = Router();

router.use(cors()); // Habilita CORS para todas las rutas

router.get("/VerClientes", getClientes);

router.get("/ClientesporID/:id", getClienteById);

router.post("/CrearClientes", crearClientes);

router.put("/ActualizarClientes/:id", updateCliente);

router.delete("/EliminarClientes/:id", deleteCliente);

router.post("/EnviarCorreo", enviarCorreo);

router.post("/PreguntasSeguridad", enviarCorreo);

router.post("/ValidarCliente", ValidarUsuario);

router.post("/CodigoVerificacionLogin", CodigoVerificacionLogin);

export default router;

