const sessions2 = {};

export const ValidarUsuario = async (req, res) => {
  const { cedula, contrasenas } = req.body;
  if (cedula == null || contrasenas == null) {
    return res.status(400).json({
      msg: "Solicitud incorrecta. Por favor llena todos los espacios",
    });
  }
  try {
    const pool = await getConnection();
    const result = await pool
      .request()
      .input("cedula", cedula)
      .query(queries.GetInicoSesion);

    if (result.recordset.length > 0) {
      const usuario = result.recordset[0];
      const contrasenaEncriptada = usuario.contrasena;
      const claveAleatoria = usuario.clave;

      // Desencriptar la contraseña almacenada en la base de datos
      const contrasenaDesencriptada = await desencriptar(
        contrasenaEncriptada,
        claveAleatoria
      );

      // Comprobar si la contraseña proporcionada coincide con la contraseña desencriptada
      if (contrasenas === contrasenaDesencriptada) {
        // Inicio de sesión exitoso
        // Enviar correo electrónico con el código de verificación
        const correoDestino = usuario.Correo;

        const resultCorreo = await sendMail(correoDestino);

        const codigoVerificacion = resultCorreo.codigoVerificacion;
        sessions2.codigoVerificacion = codigoVerificacion;
        console.log(codigoVerificacion);

        res.json({ success: true, msg: "Inicio de sesión exitoso" });
      } else {
        // Credenciales incorrectas
        res
          .status(401)
          .json({ success: false, msg: "Cédula o contraseña incorrecta" });
      }
    } else {
      // No se encontró ningún usuario con la cédula proporcionada
      res
        .status(401)
        .json({ success: false, msg: "Cédula o contraseña incorrecta" });
    }
  } catch (error) {
    console.error("Error en ValidarUsuario:", error);
    res.status(500).json({ success: false, msg: "Error interno del servidor" });
  }
};

export const CodigoVerificacionLogin = async (req, res) => {
  const { CodigoVerificacion } = req.body;
  if (CodigoVerificacion == null) {
    return res.status(400).json({
      msg: "Solicitud incorrecta. Por favor llena todos los espacios",
    });
  }
  try {
    const codigoVerificacionGuardado = sessions2.codigoVerificacion;
    if (CodigoVerificacion === codigoVerificacionGuardado) {
      res.json({ success: true, msg: "Código de verificación correcto" });
    } else {
      res
        .status(401)
        .json({ success: false, msg: "Código de verificación incorrecto" });
    }
  } catch (error) {
    console.error("Error en CodigoVerificacionLogin:", error);
    res.status(500).json({ success: false, msg: "Error interno del servidor" });
  }
};

