const nodemailer = require("nodemailer");
import { getConnection, SQl, queries } from "../database/Index";
import {
  encriptar,
  desencriptar,
  generarCodigoAleatorio,
} from "../Models/Encriptar";
import { GenerarCodigoAleatorio } from "../Models/Validaciones";
import { sendMail } from "../Models/EnviarCorreo";
import e from "express";


export const getClientes = async (req, res) => {
  try {
    const pool = await getConnection();
    const request = await pool.request().query(queries.GetAllClientes);
    res.json(request.recordset);
  } catch (error) {
    res.status(500);
    res.send(error.message);
  }
};

export const crearClientes = async (req, res) => {
  const {
    cedula,
    contrasena,
    nombre,
    fechaNacimiento,
    telefono,
    VerificarContrasena,
    VerificarCodigo,
  } = req.body;

  if (
    cedula == null ||
    contrasena == null ||
    nombre == null ||
    fechaNacimiento == null ||
    telefono == null ||
    VerificarContrasena == null
  ) {
    return res.status(400).json({
      msg: "Solicitud incorrecta. Por favor llena todos los espacios",
    });
  }
  const VerificarCodigomporCorreo = ObtenerCorreo.Correo;
  console.log(VerificarCodigomporCorreo);
  
  //if (Telefono  == null) Telefono = 0;
  const emailRegex = /^[\w-\.]+@([\w-]+\.)+[\w-]{2,4}$/;
  if (!emailRegex.test(VerificarCodigomporCorreo)) {
    return res.status(400).json({
      msg: "Formato de correo electrónico no válido",
    });
  }
  if (contrasena !== VerificarContrasena) {
    return res.status(400).json({
      msg: "Las contraseñas no coinciden",
    });
  }
  const valorRandon = await generarCodigoAleatorio();
  
  const contrasenaEncriptada = await encriptar(contrasena, valorRandon);
  try {
    
    
    const pool = await getConnection();
    
    const VerificarCodigomporCorreo = ObtenerCorreo.codigoVerificacion;
    
    console.log(VerificarCodigomporCorreo);
    console.log(VerificarCodigo);
    if (VerificarCodigomporCorreo === VerificarCodigo) {
      
      const CorreoObtener = ObtenerCorreo.Correo;
      console.log(CorreoObtener);
      const result = await pool
        .request()
        .input("cedula", SQl.VarChar, cedula)
        .input("contrasena", SQl.VarChar, contrasenaEncriptada)
        .input("nombre", SQl.VarChar, nombre)
        .input("fechaNacimiento", SQl.Date, fechaNacimiento)
        .input("Telefono", SQl.Numeric, telefono)
        .input("Correo", SQl.VarChar, CorreoObtener)
        .input("clave", SQl.VarChar, valorRandon)
        .input("TipoUsuario", SQl.VarChar, "Cliente")
        .query(queries.GetCrearNuevoCliente);
  
      const NewCLientesid = result.recordset[0].Id;
      console.log(NewCLientesid);
      res.json({
        cedula,
        contrasena,
        nombre,
        fechaNacimiento,
        telefono,
        Correo,
        TipoUsuario,
      });
    }else{
      return res.status(400).json({
        msg: "Codigo de verificación incorrecto",
      });
    }
  } catch (error) {
    res.status(500);
    res.send(error.message);
  }

};

export const getClienteById = async (req, res) => {
  const { id } = req.params;
  if (id == null) {
    return res.status(400).json({
      msg: "Solicitud incorrecta. Por favor llena todos los espacios",
    });
  }
  try {
    const pool = await getConnection();
    const result = await pool
      .request()
      .input("Id", id)
      .query(queries.GetClienteByCedula);

    res.send(result.recordset[0]);
  } catch (error) {
    res.status(500);
    res.send(error.message);
  }
};

export const deleteCliente = async (req, res) => {
  const { id } = req.params;
  if (id == null) {
    return res.status(400).json({
      msg: "Solicitud incorrecta. Por favor llena todos los espacios",
    });
  }
  try {
    const pool = await getConnection();
    const result = await pool
      .request()
      .input("Id", id)
      .query(queries.DeleteClientes);

    res.send(result);
  } catch (error) {
    res.status(500);
    res.send(error.message);
  }
};

export const updateCliente = async (req, res) => {
  const { nombre, cedula, Correo } = req.body;
  const { id } = req.params;
  if (nombre == null || cedula == null || Correo == null) {
    return res.status(400).json({
      msg: "Solicitud incorrecta. Por favor llena todos los espacios",
    });
  }
  try {
    const pool = await getConnection();

    await pool
      .request()
      .input("nombre", SQl.VarChar, nombre)
      .input("cedula", SQl.VarChar, cedula)
      .input("Correo", SQl.VarChar, Correo)
      .input("Id", id)
      .query(queries.UpdateClientes);

    res.json({ nombre, cedula, Correo });
  } catch (error) {
    res.status(500);
    res.send(error.message);
  }
};
const ObtenerCorreo = {};

export const enviarCorreo = async (req, res) => {
  const { Correo } = req.body;
  if (Correo == null) {
    return res.status(400).json({
      msg: "Solicitud incorrecta. Por favor llena todos los espacios",
    });
  }
  try {
    // Crear un transporte SMTP
    let transporter = nodemailer.createTransport({
      service: "Gmail",
      auth: {
        user: process.env.USER,
        pass: process.env.PASSWORD,
      },
    });

    // Generar un código de verificación aleatorio
    const codigoVerificacion = await GenerarCodigoAleatorio(); // Esperar a que la promesa se resuelva
    ObtenerCorreo.codigoVerificacion = codigoVerificacion;

    // Configurar el correo electrónico
    let info = await transporter.sendMail({
      from: process.env.USER, // Dirección de correo electrónico del remitente
      to: Correo, // Dirección de correo electrónico del destinatario
      subject: "Código de Verificación", // Asunto del correo electrónico
      text: `Tu código de verificación es: ${codigoVerificacion}`, // Cuerpo del correo electrónico
    });

    ObtenerCorreo.Correo = Correo;
    console.log(ObtenerCorreo.Correo);

    console.log("Correo enviado:", info.messageId);

    res.json({
      msg: "Correo enviado con éxito",
    });
  } catch (error) {
    console.error("Error al enviar el correo electrónico:", error);
    res.status(500).json({
      msg: "Hubo un error al enviar el correo electrónico",
    });
  }
};

export const preguntasSeguridad = async (req, res) => {
  const { Pregunta1, Pregunta2, Pregunta3 } = req.body;
  if (Pregunta1 == null || Pregunta2 == null || Pregunta3 == null) {
    return res.status(400).json({
      msg: "Solicitud incorrecta. Por favor llena todos los espacios",
    });
  }
  try {
    const pool = await getConnection();
    const result = await pool
      .request()
      .input("NewCLientesid", SQl.Int, NewCLientesid);
    NewCLientesid.input("Pregunta1", Pregunta1)
      .input("Pregunta2", Pregunta2)
      .input("Pregunta3", Pregunta3)
      .query(queries.GetPreguntasSeguridad);

    res.send(result.recordset[0]);
  } catch (error) {
    res.status(500);
    res.send(error.message);
  }
};

const sessions2 = {};

export const ValidarUsuario = async (req, res) => {
  const { cedula, contrasenas } = req.body;
  if (cedula == null || contrasenas == null) {
    return res.status(400).json({
      msg: "Solicitud incorrecta. Por favor llena todos los espacios",
    });
  }
  try {
    const pool = await getConnection();
    const result = await pool
      .request()
      .input("cedula", cedula)
      .query(queries.GetInicoSesion);

    if (result.recordset.length > 0) {
      const usuario = result.recordset[0];
      const contrasenaEncriptada = usuario.contrasena;
      const claveAleatoria = usuario.clave;

      // Desencriptar la contraseña almacenada en la base de datos
      const contrasenaDesencriptada = await desencriptar(
        contrasenaEncriptada,
        claveAleatoria
      );

      // Comprobar si la contraseña proporcionada coincide con la contraseña desencriptada
      if (contrasenas === contrasenaDesencriptada) {
        // Inicio de sesión exitoso
        // Enviar correo electrónico con el código de verificación
        const correoDestino = usuario.Correo;

        const resultCorreo = await sendMail(correoDestino);

        const codigoVerificacion = resultCorreo.codigoVerificacion;
        sessions2.codigoVerificacion = codigoVerificacion;
        console.log(codigoVerificacion);

        res.json({ success: true, msg: "Inicio de sesión exitoso" });
      } else {
        // Credenciales incorrectas
        res
          .status(401)
          .json({ success: false, msg: "Cédula o contraseña incorrecta" });
      }
    } else {
      // No se encontró ningún usuario con la cédula proporcionada
      res
        .status(401)
        .json({ success: false, msg: "Cédula o contraseña incorrecta" });
    }
  } catch (error) {
    console.error("Error en ValidarUsuario:", error);
    res.status(500).json({ success: false, msg: "Error interno del servidor" });
  }
};

export const CodigoVerificacionLogin = async (req, res) => {
  const { CodigoVerificacion } = req.body;
  if (CodigoVerificacion == null) {
    return res.status(400).json({
      msg: "Solicitud incorrecta. Por favor llena todos los espacios",
    });
  }
  try {
    const codigoVerificacionGuardado = sessions2.codigoVerificacion;
    if (CodigoVerificacion === codigoVerificacionGuardado) {
      res.json({ success: true, msg: "Código de verificación correcto" });
    } else {
      res
        .status(401)
        .json({ success: false, msg: "Código de verificación incorrecto" });
    }
  } catch (error) {
    console.error("Error en CodigoVerificacionLogin:", error);
    res.status(500).json({ success: false, msg: "Error interno del servidor" });
  }
};

